import ImageList from "./components/ImageList";
import SearchBar from "./components/SearchBar";
import { useState } from "react";
import axios from "axios";

const IMAGE_SEARCH_URL =
	"https://api.unsplash.com/search/photos";

function App() {
	const [images, setImages] = useState([]);

	const handleClick = (term) => {
		// const images = searchImages(term).then((data) => data);
		console.log("snvjknsdklbvnjklsrnbjkewnrsoc", images);
		setImages(images);
	};

	const searchImages = async () => {
		const response = await axios.get(IMAGE_SEARCH_URL, {
			headers: {
				Authorization:
					"Client-ID Y9LRot16RQQUiDI0eGNA8QtMcQ3XgjEVDAYT612Nnu4",
			},
			params: {
				query: "cars",
			},
		});
		console.log(response.data);
		setImages(response.data.results);
	};

	return (
		<div className="app">
			<SearchBar onSubmit={searchImages} />
			<ImageList images={images} />
		</div>
	);
}

export default App;
